import React from 'react';
import { Col, Container } from 'react-bootstrap';

const ServicePage = () => {
  const service = {id: 2, name: 'Аутсорсинг бухгалтерских услуг', price: 100000, rating: 0, img: `c8745350-5681-41c0-9a31-674f6936642e.jpg`}

  return (
    
     <Container>
       <Col md={4}>
          <Image width={300} height={300} src={service.img}/>
       </Col>
       <Col md={4}>
       
       </Col>
       <Col md={4}>
       
       </Col>
     </Container>
  );
};

export default ServicePage;
